import { Card } from "antd";
import "./UspCard.css";

export const UspCard = (props) => {
  const usp = props?.data;
  return <Card className="usp-card">
    <h1>
        {usp?.title}
    </h1>
    <Card>
        <img src={usp?.img}/>
    </Card>
  </Card>;
};
